import React from "react";
import { Modal } from "@material-ui/core";

import { useSteper } from "../../../hooks";
import {
  BookingDetailModal,
  BookingServicesModal,
  PaymentMethodsModal,
  BookingProcessEndModal,
} from "../../molecules";

export const BookingProcess = ({ isBooking, close }) => {
  const steps = [
    BookingDetailModal,
    BookingServicesModal,
    PaymentMethodsModal,
    BookingProcessEndModal,
  ];
  const { currentStep, goBack, goNext } = useSteper(steps);

  const CurrentStepComponent = steps[currentStep];
  return (
    <Modal
      className="modal"
      open={isBooking}
      disableEnforceFocus={true}
      disableAutoFocus={true}
    >
      <CurrentStepComponent goBack={goBack} goNext={goNext} close={close} />
    </Modal>
  );
};
